import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee, faChartLine } from '@fortawesome/fontawesome-free-solid';
function Icon3() {
	return (
		<div>
			<FontAwesomeIcon icon={faCoffee} />
		</div>
	);
}
export default Icon3;
